import React from "react";

function Coin({ name, icon, price, symbol, rank }) {
  return (
    <div className="coin">
      <div className="data">
        {" "}
        <h3>#{rank}</h3>
      </div>
      <div className="data">
        {" "}
        <img src={icon} />
      </div>
      <div className="data">
        {" "}
        <h1>{name}</h1>
      </div>
      <div className="data">
        {" "}
        <h3>Price: {price}</h3>
      </div>
      <div className="data">
        {" "}
        <h3>Symbol: {symbol}</h3>
      </div>
    </div>
  );
}

export default Coin;
